import React, { Component } from 'react';
import { Carousel } from 'antd';
import 'antd/dist/antd.css';

const dataitems = [
    {id:'a',pic:'contentStyle pic1',picback:'contentStyle pic1b',compliment:'孔武有力',time:'20210505'},
    {id:'b',pic:'contentStyle pic2',picback:'contentStyle pic2b',compliment:'美若天仙',time:'20210505'},
    {id:'c',pic:'contentStyle pic3',picback:'contentStyle pic3b',compliment:'可可爱爱',time:'20210505'},
    {id:'d',pic:'contentStyle pic4',picback:'contentStyle pic4b',compliment:'妖艳性感',time:'20210505'},
]

class Header extends Component {
    render() { 
        return(
            <>
            <Carousel className="zone">
                {
                    dataitems.map((items) => {
                        return (
                            <div className={items.id}>
                                <div className={items.pic}>{items.id}</div>
                                <div className={items.picback}>
                                    <p className="compliment">{items.compliment}</p>
                                    <p className="time">{items.time}</p>
                                </div>
                            </div>

                        )
                    })
                }
            </Carousel>
            </>
        );
    }
}

export default Header;
